function arlo_tm_anchor() {
  "use strict";

  jQuery('.anchor_nav').onePageNav();
  var scrollOffset = 0;
  jQuery(".anchor a").on('click', function (evn) {
    evn.preventDefault();
    jQuery('html,body').scrollTo(this.hash, this.hash, {
      gap: {
        y: -scrollOffset - 85
      },
      animation: {
        duration: 1500,
        easing: "easeInOutExpo"
      }
    });
    return false;
  });
} // -----------------------------------------------------
// ----------------    CONTACT FORM    -----------------
