// -----------------------------------------------------


function arlo_tm_about_animation() {
  "use strict";

  if ($('.parallax').length > 0) {
    var scene = $('.parallax').get(0);
    var parallax = new Parallax(scene, {
      relativeInput: true,
      onReady: function onReady() {
        console.log('ready!');
      }
    });
  }
}

